I have way too much fun doing these little set up for my boys. I realized it’s helped them in the real world. We often play market and one time we went to the dollar store and they each picked one toy to take with them. Most of the time they are very impatient and want to open it or leave without paying because well they are 2 and 3 and  are not patient and have no idea that they need to pay for it. After playing with them and showing them the exchange in money for the items, they had a better understanding of coins, dollar bills, and cards. And once they picked their toys they were patient to wait in the checkout line. They greeted the woman “hello, sir can i buy this?” (I call them sir 🤭 when we play) and even told me i needed to pay with my credit card. I was extremely surprised they grasped all of that from us just playing in our basement. There used to be meltdowns at checkout before and now they enjoy watching us go through it. 

I have always been a crafty person, ever since I was a child and love creating just about anything. And now in the current motherhood phase I am in my life of young toddlers this is my creative outlet and I absolutely love it. What should I make next?

